$GLOBALS["lang"]['<p><strong>Baseline</strong> - The overarching document that contains the baseline definition and the individual policy tests.<br> <br> <strong>Policies</strong> - The individual tests contained within a Baseline. Each test is for a specific item. An example would be testing for SSH version 1.2.3.<br> <br> <strong>Details</strong> - Baselines can compare netstat ports, users and software.<br> <br> <strong>Software</strong> - To compare software we check the name and version. Because version numbers are not all standardised in format, when we receive an audit result we create a new attribute called software_padded which we store in the database along with the rest of the software details for each package. For this reason, baselines using software policies will not work when run against a device that has not been audited by 1.10 (at least). Software policies can test against the version being "equal to", "greater than" or "equal to or greater than".<br> <br> <strong>Netstat Ports</strong> - Netstat Ports use a combination of port number, protocol and program. If all are present the policy passes.<br> <br> <strong>Users</strong> - Users work similar to Netstat Ports. If a user exists with a matching name, status and password details (changeable, expires, required) then the policy passes.<br> <br> </p>'] = '<p><strong>バズリニオ ノム・デ・ラ・ヴィル(ファカルターティフ、サンズ・ドート・パス・ベソイン・デューン・トラダクション)</strong> La superkaddokumento kiu enhavas la bazliniodifinon kaj la indifuajn strategitestojn.<br/> <br/> <strong>ポリティカ</strong> La ininfutuaj commercij enhavitaj ene de Bazlinio. Mina sintoiu testo estas por specifa objectto. Ekzemplo estus testata pri SSH-versio 1.2.3.<br/> <br/> <strong>デタロジ</strong> Bazlinioj povas kompari retstat hasnojn, uzantojn kaj softvaron.<br/> <br/> <strong>ムースライン</strong> Por kompari softvaron ni controlas la nomon kaj versioon. Identificar versio nombroj neestas Tial, bazlinioj uzantaj softvarpolitikojn ne funkcias dum kuro kontra epäilty aparato kiu ne estis reviziita per 1.10 (almena kaptlus). Softvarpolitikoj povas testi kontrauna la versio estanta "egalaj al", "pli gra ol" kaptus al egala al a difetto pli granda ol ".<br/> <br/> <strong>プエルト・ネットスタット</strong> Netstat ポート uzas kombina Se <br/> <br/> <strong>L\'Unione ユーロペエンヌ</strong> Uzantoj 労働者 simpiaj al Netstat プエルト. Se uzanto eksistas kun egala nomo, stato kaj pasvorton detaloj (publikaan Progresssiveblaj, eksvalidias, postulis) tiam la politiko pasas.<br/> <br/> </p>';

