$GLOBALS["lang"]['<p>Being able to determine which machines are configured the same is a major part of systems administration and auditing &ndash; and now reporting on that will be made simple and automated. Once you define your baseline it will automatically run against a set of devices on a predetermined schedule. The output of these executed baselines will be available for web viewing, importing into a third party system or even as a printed report.<br> <br> Baselines enable you to combine audit data with a set of attributes you have previously defined (your baseline) to determine compliance of devices.<br> <br> For example - you might create a baseline from a device running Centos 6 which acts as one of your apache servers in a cluster. You know this particular server is configured just the way you want it but you are unsure if other servers in the cluster are configured exactly the same. Baselines enables you to determine this.<br> <br> </p>'] = '<p>Povas determini kiuj ma apretinoj estas formitaj la sama estas grava parto de sistum amministrativicio kaj revizio - kaj nun raportante privio estas farita simma kaj a skeptomatigita. キム・ヴィ・ディフィナス・リン・バズリニオン εi a skeptidtomate kuris kontraluc aparatoj en ankeriasnevalt obellaks märatud horaro. La produktado de tiuj efekkivigitaj bazlinioj estas hasbla por interretspektado, importe en trian partian sistemon a spective e kiel presita raporto.<br/> <br/> Bazlinioj rajtigas vin kombini reviziodatenojn kun aro de atentioj kiuj vi anta<br/> <br/> Ekzample、vi eble kreos bazlinion de aparato prizorgata Centojn 6 kiu funkcias kiel unu el viaj apa reomendarserviloj en あります。 L\'Unione ヨーロッパ<br/> <br/> </p>';

