$GLOBALS["lang"]['<p>Credentials are encrypted when stored in the database.<br> <br>When a Discovery is run, a device has its credentials retrieved and tested for connection first (from the <code>credential</code> table). If these fail, then credentials associated with the given Org <code>credentials.org_id</code> is also tested against the device. Working credentials are stored at an individual device level in the credential table (note - no "s" in the table name).<br> <br>SSH keys are tested before SSH username / password. When testing SSH, credentials will also be marked as working with sudo or being root.<br> <br>For ease of use, Windows passwords should not contain a single or double quote. This is a remote WMI limitation, not an Open-AudIT limitation.<br> <br></p>'] = '<p>Crédenciales estas, オーストラリア <br/> <br/>キムディスカバリーestas prizorgita、aparato havas siajn akredita... <code>credential</code> タクロ。 Se tiuj malsukcesas, tiam akredita... <code>credentials.org_id</code> Én ankaestas Presente kontra. ラ aparato. Labaj akredita.oj estas stokitaj sur finundua aparatnivelo en la lunarktablo (noto - neniuj "j" en la tablonomo).<br/> <br/>SH-aprettosiloj estas estetaj anta. SSH-Urantinomo/pasvorton. _ 株式会社ドリテック Dum testado de SSH, アカデ...<br/> <br/>Por membrieco de uzo, Fenestroj ne devus enhavi ununuran épäilty duoblan citaononon. Tio estas malpreksima WMI- limigo, ne オープン オーディション limigo.<br/> <br/></p>';

