$GLOBALS["lang"]['<p>Define your racks and assign devices into their positions. You already have your devices in Open-AudIT and you know your locations. Open-AudIT extends this to allow you to create a rack and assign devices to it. Open-AudIT will even provide a visualisation of the rack and the devices contained within. If you provide a device picture, that picture will be used in the visualisation. You can look at the rack on the screen and see the same items you would see if you were standing in front of it.<br> <br></p>'] = '<p>Difini viajn rakojn kaj asagi aparatojn en iliajn poziciojn. Vijam havas viajn aparatojn en Open- オーディション kaj vi scias viajn lokojn. オーディション etendasment por permesi al vi krei rakon kaj asigni aparatojn al εi. 監査 e Se vi disponigas aparatobildon, tiu bildo esto uzita en la bildigo. Vi povas rigardi la rakon sur la ekrano kaj vidi la samajn erojn vidus se vi staris anta. お問い合わせ<br/> <br/></p>';

$GLOBALS["lang"]['<p>Devices on your network need to be managed. But how do you keep your records up to date? A spreadsheet - defintley not. That will be out of date in hours, if not days. Why manually try to keep up. Use Open-AudIT to automatically scan your networks and record your devices - manufacturer, model, serial and more than 100 other attributes. Full lists of software, services, disks, open ports, users, etc. Automatically see if an attribute has been added, removed or changed.<br> <br>Once Open-AudIT is setup, you can sit back and relax. Have change reports emailed to you on a schedule, for example - what new devices did we discover this week? What new software was installed this week? Were there any hardware changes last month?<br> <br>Expand on the stored fields easily with your own custom attributes.<br> <br>Even add devices that are not connected to your network or those devices your Open-AudIT server cannot reach.<br> <br>Computers, switches, routers, printers or any other device on your network - Open-AudIT can audit them all.<br> <br></p>'] = '<p>リトmurtaa esti alkalmazásによるAplikas。 Kiel vi tenas viajn discojn εis nunna? Ekskurseto - デフィニションネ. Tio esto el dato en horoj, se ne tagoj. Kial vi prova elliti. Uzu Open- Aud IT は、Spectivetomate skani viajn retojn kaj registrei viajn aparatojn Plenaj listaj de softvaro、servoj、disquete、malfermaj hasnoj、uzantoj、ktp です。 Epäilty Tomata vido se atentio a estis aldonita, フォリダ epäilty tääään ilaita.<br/> <br/>キムパブブリコ オープン監査estas aranaño, vi povas sidi malanta Tu veux ビエン? Kio nova プログラムマロ estis instaliata チェ・セマジネ? Te Sientes マル?<br/> <br/>Aplikita sur la stokitaj kapoj kun with propra kutimo atteria 来ます.<br/> <br/>E agenda aldoni paratojn kiuj ne estasligitaj al kaudu reto スペクティブ tiuj aparatoj aparatoj ビア Open- 監査 servilo ne povas atingi.<br/> <br/>Komputiloj、Matchtiloj、alkuristoj、printiloj a epäillyn ajna alias aparato sur via reto - オープン監査 povas revizii ilin † iuj.<br/> <br/></p>';

$GLOBALS["lang"]['<p>Discoveries are at the very heart of what Open-AudIT does.<br> <br>How else would you know "What is on my network?"<br> <br>Discoveries are prepared data items that enable you to run a discovery upon a network in a single click, without entering the details of that network each and every time.<br> <br></p>'] = '<p>エルトロヴァ<br/> <br/>キエル・ヴィの坐骨「キオ・エスパス・シュル・ミア」?<br/> <br/>エルトロヴァ<br/> <br/></p>';

$GLOBALS["lang"]['<p>Discovery Options are a global setting changed in the <a href="../configuration?configuration.name=discovery_default_scan_option">configuration</a>. If you have an Open-AudIT Enterprise license these are settable per discovery and in addition futher customizable as required. Discovery Options are as follows (including an indicitave time to scan an individual IP):<br/><br><strong>UltraFast</strong>: <i>1 second</i>. Scan only the ports that Open-AudIT needs to use to talk to the device and detect an IOS device (WMI, SSH, SNMP, Apple Sync). An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is not considered open. Device must respond to an Nmap ping. Use aggressive timing.<br><br/><strong>SuperFast</strong>: <i>5 seconds</i>. Scan the top 10 TCP and UDP ports, as well as port 62078 (Apple IOS detection). An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is not considered open. Device must respond to an Nmap ping. Use aggressive timing.<br/><br/><strong>Fast</strong>: <i>40 seconds</i>. Scan the top 100 TCP and UDP ports, as well as port 62078 (Apple IOS detection). An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is not considered open. Device must respond to an Nmap ping. Use aggressive timing.<br/><br/><strong>Medium (Classic)</strong>: <i>90 seconds</i>. As close to a traditional Open-AudIT scan as we can make it. Scan the top 1000 TCP ports, as well as 62078 (Apple IOS detection) and UDP 161 (SNMP). An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is considered open (and will trigger device detection). Devices are scanned regardless of a response to an Nmap ping. Use aggressive timing.<br/><br/><strong>Medium</strong>: <i>100 seconds</i>. Scan the top 1000 TCP and top 100 UDP ports, as well as port 62078 (Apple IOS detection). An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is not considered open. Device must respond to an Nmap ping. Use aggressive timing.<br/><br/><strong>Slow</strong>: <i>4 minutes</i>. Scan the top 1000 TCP and top 100 UDP ports, as well as port 62078 (Apple IOS detection). Version detection enabled. An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is considered open (and will trigger device detection). Device must respond to an Nmap ping. Use normal timing.<br/><br/><strong>UltraSlow</strong>: <i>20 minutes</i>. Not recommended. Scan the top 1000 TCP and UDP ports, as well as port 62078 (Apple IOS detection). Devices are scanned regardless of a response to an Nmap ping. Version detection enabled. An <code>open|filtered</code> port is considered open. A <code>filtered</code> port is considered open (and will trigger device detection). Use polite timing.<br/><br/><strong>Custom</strong>: <i>Unknown time</i>. When options other than as set by a standard discovery preset are altered.<br><br></p>'] = '<p>Découverte Opcioj estas tutmonda scenaro <a href="../configuration?configuration.name=discovery_default_scan_option">(コンフィグラシオ)</a>お問い合わせ Se vi havas Open- 監査 Licenza di impresa su tiaj estas aroblaj per eltrova.o kaj krome kunfandas kiel postulat. Découverte Opcioj estas kiel sekvas (inkluzive de pulvtempo por skani ininfuan IP):<br/><br/><strong>ウルトララピダ</strong>: : : <i>1 セカンド</i>お問い合わせ Skalo nur la hasnoj kiuj Open- AudIT murtaa uzi por paroli al la aparato kaj detekti IOS- aparaton (WMI, SSH, SNMP, Apple Sync). アンダルト・コサ <code>open|filtered</code> Hasno estas konsidrata malferma. お問い合わせ <code>filtered</code> Pas d\'estas konsidrata malferma. Devas de dispositivo responsi al Nmap ping. 宇津 agresmeni Tempigon.<br/><br/><strong>スーパーキル</strong>: : : <i>5 組込み</i>お問い合わせ Ska la supraj 10 TCP kaj UDP- hasnoj, mimo kiel hasno 62078 (Omena IOS- detekto). アンダルト・コサ <code>open|filtered</code> Hasno estas konsidrata malferma. お問い合わせ <code>filtered</code> Pas d\'estas konsidrata malferma. Devas de