$GLOBALS["lang"]['<p>If you add a device type, to display the associated icon you will have to manually copy the .svg formatted file to the directory:<br><em>Linux</em>:/usr/local/open-audit/public/device_images<br><em>Windows</em>: c:\xampp\htdocs\open-audit\device_images<br> <br>If you add a location type, to display the associated icon you will have to manually copy the 32x32px icon to the directory:<br><em>Linux</em>:/usr/local/open-audit/public/images/map_icons<br><em>Windows</em>: c:\xampp\htdocs\open-audit\images\map_icons</p><p>When the <i>resource</i> is a <code>device</code>, valid <i>types</i> are: <code>class</code>, <code>environment</code>, <code>status</code> and <code>type</code>. If the <i>resource</i> is <code>locations</code> or <code>org</code> the only valid <i>type</i> is <code>type</code>. If the <i>resource</i> is a <code>query</code> the only valid <i>type</i> is <code>menu_category</code>.</p>'] = '<p>Se vi aldonas paratospecon, por elmontri la rilatan ikonon vi de mane kopii la .svg formatis dosieron al la adresaro:<br/><em>リヌクソ</em>/ usr / loka / malferma- 監査 / publika / devicen _ immagini<br/><em>フェネストロジ</em>c: \'\ xamp\' htdocs \'open-edit\ dispositivo _ immagini<br/> <br/>Se vi aldonas loksspecton, por elmontri la rilatan ikonon vi de mane kopii la 32x32px ikonon al la adresaro:<br/><em>リヌクソ</em>/ usr / loka / malferma- 監査 / publika / bildo / mappa _ ikoonid<br/><em>フェネストロジ</em>c: "\ xamp \'htdocs\' オープン - 監査\ image\ マップ _ ikoonid</p><p>キム・ラ <i>ヤンドゥルソ</i> エスズ <code>device</code>ログイン <i>ティポロギア</i> Értékelések: <code>class</code>スタッフ <code>environment</code>スタッフ <code>status</code> カジ <code>type</code>お問い合わせ ツイート <i>ヤンドゥルソ</i> エスズ <code>locations</code> ツイート <code>org</code> ラ・ソラ・ヴァリ <i>トピックス</i> エスズ <code>type</code>お問い合わせ ツイート <i>ヤンドゥルソ</i> エスズ <code>query</code> ラ・ソラ・ヴァリ <i>トピックス</i> エスズ <code>menu_category</code>お問い合わせ</p>';

$GLOBALS["lang"]['<p>If you intend to completely audit your cloud machines, do not forget you will also need those credentials saved in Open-AudIT.</p><p>Make sure you allow the correct ports if you are using Microsoft Azure (22 for SSH, etc). Check your Virtual Machine -> Networking rules.<br> <br></p>'] = '<p>Se vi intencas tute revizii viajn nubajn ma apretinojn, ne forgesu kee vi ankainabezonos tiujn akredita.ojn savitajn en open- 監査.</p><p>Certigu ke vi permesas la εustann hasnojn se vizas Microsoft Azure (22 por SSH, ktp). Kontrau vian virtualan ma apretinon - Retaj reguloj.<br/> <br/></p>';

$GLOBALS["lang"]['<p>If you select a List type, the "values" field will be enabled. You should put a comma separated list of selectable values here. These will display in a dropdown box whenever the field is edited.<br> <br>Like most other attributes, Fields can be bulk edited. Use the Bulk Edit function as you normally would and you will see the Fields are available for input.<br> <br>View the device details screen, open the section containing the field and (if you have sufficient access) you can click on the field value to edit it.<br> <br></p>'] = '<p>Se vi elektas lista tipon, la "valoroj" kampo esto ebligitaj. Vi devus meti komon apartigita Lista de fajnaj valoroj clari huulet. Tiuj elmontros en goto- kesto kiam la kampo estas redaktita.<br/> <br/>Kiel la pléj indennitàj aliasj atregultoj, Kampoj povas esti grocaj redactis. Uzu la Bulk Edit- funkcion kiam vi normale faris kaj vidos ke la kampoj estas hasblaj por eniga.<br/> <br/>Vidante la aparaton detalekrano, malfermi la sekcion enhavantan la kampon kaj (se vi havas sufibraan aliron) Vi povas klaki sur la kampvalo por redakki... で.<br/> <br/></p>';

$GLOBALS["lang"]['<p>In the ever-changing world of computer security where new vulnerabilities are being discovered and patched every day, enforcing security compliance must be a continuous process. It also needs to include a way to make adjustments to policies, as well as periodic assessment and risk monitoring. The OpenSCAP ecosystem provides tools and customizable policies for a quick, cost-effective and flexible implementation of these processes.</p>'] = '<p>En la iam- ajna- varia mondo de komputionskuleco kie novaj vundeblecoj estas malkovritaj kaj pecetigitaj ... La OpenSCAP ekositemo disponigas iljn kaj adattaitajn politikojn por rafa, kostefika kaj freksebla efektivigo de tiaj procezoj.</p>';

