$GLOBALS["lang"]['<p>Microsoft Windows desktop systems have network limitations that may impact the performance of Open-AudIT. The TCP/IP stack limits the number of simultaneous incomplete outbound TCP connection attempts. After the limit is reached, subsequent connection attempts are put in a queue and will be resolved at a fixed rate (10 per second). If too many enter the queue, they may be dropped. And finally, Apache will be restarted by the OS. For this reason, installing Open-AudIT on a Windows desktop operating system is not supported.<br><br>There is nothing wrong with the Open-AudIT code, nor can we do anything to address this issue on Windows client machines.'] = '<p>Microsoft Fenestroj havas retlimigojn kiuj povas trafi la prezenton de Open- 監査. La TCP / Ip- スタコリミガスラノブロンダサムテンパジネコムプラタジ ралика TCP- ligprovoj. Poste kiam la limo estas atingita, postaj konektprovoj estas metitaj enendovicon kaj estos solvitaj チェ・フィックスティーア・ラピッドエコ(10パーセコンド)。 Setro fortunaj eniras la atendon, ili povas esti faligitaj. Kajfinfinfinine, 珍しいestos rekomencita fare de la Os. Tial, instali Open- 監査 sur Windows- tablo opéracium ne estas apogita.<br/><br/>Ekzistas ネオマ</p>';

$GLOBALS["lang"]['<p>Nmap timing details are found on the bottom of this linked page <a href="https://nmap.org/book/man-performance.html" target="_blank">https://nmap.org/book/man-performance.html</a>. From that page:<br> <br><em>If you are on a decent broadband or ethernet connection, I would recommend always using -T4 (Aggressive). Some people love -T5 (Insane) though it is too aggressive for my taste. People sometimes specify -T2 (Polite) because they think it is less likely to crash hosts or because they consider themselves to be polite in general. They often do not realize just how slow -T2 really is. Their scan may take ten times longer than a default scan. Machine crashes and bandwidth problems are rare with the default timing options -T3 (Normal) and so I normally recommend that for cautious scanners. Omitting version detection is far more effective than playing with timing values at reducing these problems.</em><footer>Gordon <i>Fyodor</i> Lyon</footer><br> <br></p>'] = '<p>Nmap Tempigas detalojn estastrovitaj sur la fondo de tiuligita pacomamento <a href="https://nmap.org/book/man-performance.html" target="_blank">https: / nmap.org / libro / uomo- パフォーマンス. ツイート</a>お問い合わせ デ tiu paεo:<br/> <br/><em>Se vi estas sur deka gradidabendo a difetto tero ligo, mi remomendus ciiam uzi T4 (Agres). Kelkaj の同輩 amas - T5 (Insane) kvankam の liquiciulici estos tro concordasema por mia gusto. ホモジ フォジェ prezigas Iliオーバーセne ekkomprenas ekzakte kiom malladrapa - T2 vere estas. Ilia skanado povas preni dek fojojn pli downe ol deva guidlta skanado. マ apretinkra apretoj kaj bendolarεproblemooj estas raj kun la dea guidtlataj Tempigelektoj - T3 (normaalne) kaj tien mi normale rekomendastion por singardaj skaniloj. Uzanta versio detekto estas multe pli efika ol ludado kun Tempigvaloroj Reduktado de tiauj 問題.</em><footer>C\'e\' ゴードン. <i>フィヨドレ</i> ログイン</footer><br/> <br/></p>';

