$GLOBALS["lang"]['<p>Open-AudIT provides multi-tenancy out of the box!<br> <br>Orgs (organisations) in Open-AudIT are a key item. A user has a primary Org as well as a list of Orgs they can access. A user combines this with a list of assigned "Roles" that define what actions they can take on items assigned to the Orgs they have access to. The combination of a users "orgs" and "roles" define what they can and cannot do within Open-AudIT.<br> <br>Most items in Open-AudIT are assigned to an Org. Devices, Locations, Networks, etc.<br> <br>Orgs can have child Orgs. Think of an organisational chart (tree) structure. If a user has access to a specific Org, they also have access to that Orgs descendants. For more information, see this <a href="/index.php/faq?name=Users, Roles and Orgs">FAQ</a>.</p>'] = '<p>Open- Aud Disponigasマルチテナンスエルラスクアトロ!<br/> <br/>Orgs (organizoj) en Open- 監査estas esenca objectko. Uzantoj havas プラマラン Org mimo kiel lister de Orgas kiun ili povas aliri. Uzanto Kombinastion kun lista de asignitaj "Roles" kiuj difinas kion beforej ili povas preni erojn asignitaj al la Orgs kiujn ili havas al. ラコビナ<br/> <br/>La plej indennitàj en Open- 監査estas asignitaj al Org. Dispositivos, Lokoj, Retoj, ktp.<br/> <br/>Orgoj povas havi Infanon orgs. Pensu pri organiza kaavio (arbo) strukturo. Se uzanto havas aliron al specifa Org, ili anka. L\'objectif est d\' améliorer la qualité de l\'eau. Por pli da informatoj, ビドゥ <a href="/index.php/faq?name=Users, Roles and Orgs">リッチエスタ KKKについて</a>お問い合わせ</p>';

