$GLOBALS["lang"]['<p>Roles in Open-AudIT are a key item. A user has a primary Org as well as a list of Orgs they can access. A user combines this with a list of assigned Roles that define what actions they can take on items assigned to the Orgs they have access to. The combination of a users "orgs" and "roles" define what they can and cannot do within Open-AudIT.<br> <br>
        Get the complete Open-AudIT Enterprise experience. Creating roles allows fine grained control over what your users can do within Open-AudIT.<br> <br>
        The primary method for authorisation (what a user can do) is based on the users Roles. Default roles are defined as admin, org_admin, reporter and user. Each role has a set of permissions (Create, Read, Update, Delete) for each endpoint. The ability to define additional roles and edit existing roles is enabled in Open-AudIT Enterprise.<br> <br>Roles can also be used with LDAP (Active Directory and OpenLDAP) authorisation. Enterprise licensed installations have the ability to customise the LDAP group for each defined role.<br> <br></p>'] = '<p>Roloj en Open- Aud.i estas esenca objectko. Uzantoj havas プラマラン Org mimo kiel lister de Orgas kiun ili povas aliri. Uzanto Kombinasment kun lista de asignitaj roloj kiuj difinas kiuj ili povas preni erojn asignitaj al la orgs kiujn ili havas aliron al. ラコビナ<br/> <br/>秋里 il kompletaani オープン 監査 企業 精子。 Kreante rolojn permesas al Bona Grenita kontrolo de pion viaj uzantoj povas fari ene de open- 監査.<br/> <br/>La primara metodo por apuro (kio uzanto povas fari) estas bazita sur la uzantroj. Defa.ltaj roloj estas difinitaj kiel admin, org _ 管理者, raportisto kaj uzanto. imitaiu rolo havas aron de permesoj (Crear, Leeri, Actualisar, Eliminar) por. La kapablo difini kromajn rolojn kaj redakti ekzistajn rolojn estas ebligita en オープン監査 企業.<br/> <br/>Roloj anka Yrities installazione della licenza, イタリア<br/> <br/></p>';

