$GLOBALS["lang"]['<p>Tasks have a schedule that mirrors the unix cron schedule. The attributes for minute, hour, day_of_month, month, day_of_week all act as per the cron definitions. You can select multiples of these using comma seperated values (no spaces). You can select every value using *.<br> <br>The <code>type</code> of the task can be one of: baselines, collectors, discoveries, queries, reports or summaries.<br> <br>If you wish to schedule a Baseline or Discovery, you will need to create these before creating the tasks. You must use the ID of the type of item in <code>sub_resource_id</code>. For example if you wish to schedule a Discovery, use that particular Discoveries ID in <code>sub_resource_id</code>.<br> <br>The value for <code>uuid</code> is specific to each Open-AudIT server. Your unique value can be found in the configuration.<br> <br>The <code>options</code> attribute is a JSON document containing any extra attributes required to run the task. The extra attributes for reports, queries and summaries are: <code>email_address</code> and <code>format</code>. The extra attribute for Bselines is <code>group_id</code>.<br> <br></p>'] = '<p>Taskoj havas horaron kiu spegulas la unix Kron Horaron. La atentioj por, horo, タグ _ di _ monato, Mononato, タグ _ di _ semajno Funkcias kiel par la kno difinoj. Vi povas selekti multoblojn de tiiuj uzantaj komm seetiajn valorojn (neniuj spacoj). Vio povas elekti, キプロス <br/> <br/>ラ・ミア <code>type</code> La Tapo povas esti unu el: bazlinioj, kolektantoj, eltrova.oj, requestoj, raportoj a resumoj.<br/> <br/>Se vi deziras plani Bazlinion su katlus Discovery, vi bezonos krei tiiujn antaluc kreado de la takoj. Vi bruts uzi la ID de la tipo de objectkto en <code>sub_resource_id</code>お問い合わせ Ekzample se vi deziras plani ディスカバリー, uzi tiun spesialian malkovron <code>sub_resource_id</code>お問い合わせ<br/> <br/>ヴァロ <code>uuid</code> Estos espectros por ビア unika valoro povas esti trovita en la konfiguracio.<br/> <br/>ラ・ミア <code>options</code