$GLOBALS["lang"]['<p>The Collectors feature enables you to easily manage many "collector" computers that perform network discovery. All Collectors are centrally controlled from the Server. The only required network ports between the Collector and the Server are 80 and/or 443.<br> <br>It makes managing disparate networks quick, easy and simple. Open-AudIT Enterprise licensees get a single collector license included and have the option to buy more as required..<br> <br></p>'] = '<p>La kolektantoj igas vin と administri fortunajn "kolktilon" kiuj elfaras sendostacian eltrova. imitaiuj kommunktantoj estas centro kontrolitaj de la Servilo. La nuraj postulataj rethavenoj インター ラ kolektanto kaj la Servilo estas 80 kaj / a. 443.<br/> <br/>お問い合わせ 監査 ouvert ecoicoj risovas ununuran kolektantlicencon inkludis kaj havas la opcion por arcaeti pli kie postulat.<br/> <br/></p>';

$GLOBALS["lang"]['<p>The SELECT section of your SQL <em>must</em> contain fully qualified columns. IE - <code>SELECT devices.id AS `devices.id`, devices.name AS `devices.name` ...</code>.<br> <br>The WHERE section of your SQL <em>must</em> contain <code>WHERE @filter</code> so Open-AudIT knows to restrict your query to the appropriate Orgs. SQL not containing this condition will result in the query failing to be created, unless you have the Admin role.<br> <br>An example query SQL showing attributes on devices that have an <code>os_group</code> attribute of "Linux" - <br><code>SELECT devices.id AS `devices.id`, devices.icon AS `devices.icon`, devices.type AS `devices.type`, devices.name AS `devices.name`, devices.os_name AS `devices.os_name` FROM devices WHERE @filter AND devices.os_group = "Linux"</code><br> <br></p>'] = '<p>La SELECT sekcio de via SQL _ ラ・セックシオ・デ・バイ・SQL <em>デビアス</em> Enhavas terv kvalifikitajn kolonojn. IE - 日本語 <code>SELECT devices.id AS `devices.id`, devices.name AS `devices.name` ...</code>お問い合わせ<br/> <br/>SQLによるLa sekcio de <em>デビアス</em> インハバ <code>WHERE @filter</code> Tiel Open- Aud Escias limigi vian atendon al la konvenaj Orgs. SQL ne enhavanta tiun Kontrircaon rezultigos la atendon malsukcesantan esti kreita, se vi havas la Admin rolon.<br/> <br/>Ekzemplo kysely SQL の Montranta atregattojn sur aparatoj kiuj havas <code>os_group</code> リヌクソ <br/><code>SELECT devices.id AS `devices.id`, devices.icon AS `devices.icon`, devices.type AS `devices.type`, devices.name AS `devices.name`, devices.os_name AS `devices.os_name` FROM devices WHERE @filter AND devices.os_group = "Linux"</code><br/> <br/></p>';

$GLOBALS["lang"]['<p>The SELECT section of your SQL <em>must</em> only contain <code>DISTINCT(devices.id)</code>.<br> <br>The WHERE section of your SQL <em>must</em> contain <code>WHERE @filter</code> so Open-AudIT knows to restrict your query to the appropriate Orgs. SQL not containing this condition will result in the group failing to be created.<br> <br>An example for SQL to select all devices running the Debian OS - <code>SELECT DISTINCT(devices.id) FROM devices WHERE @filter AND devices.os_family = "Debian"</code><br> <br></p>'] = '<p>La SELECT sekcio de via SQL _ ラ・セックシオ・デ・バイ・SQL <em>デビアス</em> ヌル・エンハバ <code>DISTINCT(devices.id)</code>お問い合わせ<br/> <br/>SQLによるLa sekcio de <em>デビアス</em> インハバ <code>WHERE @filter</code> Tiel Open- Aud Escias limigi vian atendon al la konvenaj Orgs. SQL ne enhavanta tiun kontircaon rezultigos la grupon malsukcesantan esti kreita.<br/> <br/>Ekzemplo por SQL selekki ciiujn aparatojn kurantajn la Debian Os... <code>SELECT DISTINCT(devices.id) FROM devices WHERE @filter AND devices.os_family = "Debian"</code><br/> <br/></p>';

