$GLOBALS["lang"]['A campus area network (CAN) is made up of an interconnection of LANs within a limited geographical area. The networking equipment (switches, routers) and transmission media (optical fiber, copper plant, Cat5 cabling, etc.) are almost entirely owned by the campus tenant / owner (an enterprise, university, government, etc.).<br><br>For example, a university campus network is likely to link a variety of campus buildings to connect academic colleges or departments, the library, and student residence halls.'] = 'カンプタレト(CAN)は、エル・インターリゴ・デ・ラノジ・エネ・デ・リミガ・ジオグラダソで構成されています。 ラ・インターコネクタ・エキパ<br/><br/>Ekzample、universitata kampusreto verajne interligas gamon da kampuskinstrua.oj por ligi akademiajn altlernegojn a sekciojn, la bibliotekon,kaj collegeeajn lo.ejhalojn.';

