$GLOBALS["lang"]['A new user logged in to Open-AudIT and was authenticated and authorized by the LDAP sever. That user was then created in Open-AudIT and logged in. Success.'] = 'Nova uzanto(ノヴァ・ウガント) Registerdis en al Open- 監査 kaj est un skeptikita kaj rajtigita fare de la LDAP sever. Tiu uzanto tiam estis kreita en open- オーディション kaj ensalutinta. スカンセソ。';

$GLOBALS["lang"]['A package is a piece of installed softare. A package has a type - antivirus, approved, backup, banned, cloud, firewall, ignored, license or other.'] = 'Pakao estas peco de secretita moolo. パカ';

