$GLOBALS["lang"]['A person has an account in the Open-AudIT application. Their user account has a list of associated Roles and Organizations. The roles the user has determines WHAT they can do. The Organizations a user has determines WHICH items they can act upon.<br><br>When a user requests to perform an operation (create, read, update, delete) on a collection item, the roles are consulted to see if they are allowed to perform that action, then the orgs are consulted to determine if the collection item belongs to an org the user has permission to act on.'] = 'Persono havas raporton en la open- オーディション aplika.o. Ilia uzantkonto havas listan de rilataj roloj kaj organisoj. La roloj kiujn la uzanto deterwa ili povas fari. La organisoj uzanto deterica mikä erojn ili povas agi sur.<br/><br/>Kiam uzanto petas elfari oopperacion (krei, legi, liukoisdatigi, forigi) sur kolektobjektoj, la roloj estas konsultitaj por vidi claru ili estas permesitaj elfari tiun agon, tiam la orgs konsultitaj determini ';

$GLOBALS["lang"]['A personal area network (PAN) is a computer network used for communication among computer and different information technological devices close to one person. Some examples of devices that are used in a PAN are personal computers, printers, fax machines, telephones, PDAs, scanners, and even video game consoles. A PAN may include wired and wireless devices. The reach of a PAN typically extends to 10 meters. A wired PAN is usually constructed with USB and FireWire connections while technologies such as Bluetooth and infrared communication typically form a wireless PAN.'] = 'Persona isto (PAN) estas kompytila uzita por kommunikado inter komputio kaj malsamaj soatojteknologiaj apotoj preksimaj al unu persono. Kelkaj eczemoj de aparatoj kiuj estas uzitaj en PAN estas personaj komputiloj, printiloj, faksoma activitanoj, Telefonoj, PDAoj, skaniloj, kaj e proporción videoludkonzoloj. PAN povas inkludi dratigijn kaj serratajn aparatojn. La atingo de PAN tipe etendi nidetta al 10メトロj. Metita PAN estas kutime koronuita kun USB kaj FireWire ligoj dum teknologioj kiel ekzample Bluetooth kaj infraruditoa kommunikado tipe formas serratan PAN.';

$GLOBALS["lang"]['A query is essentially a SQL statement. This statement is run against the database with the automatic addition of the limit, filtered to apply to only those requested items and only those items the user has permission to view. A Query can be created using menu -> Manage -> Queries -> Create Queries. Queries contain an org_id and are hence restricted to the appropriate users. A user must have the org_admin or reporter role(s) to create, update or delete a query. All users can execute a query. A query has a name attribute used for the menu item as well as a menu category attribute. This tells the Open-Audit GUI which submenu to place the query in. There is also menu display which should be set to <i>y</i> to enable the query in the GUI (<i>n</i> to prevent the query from appearing at all). The query would still run if called using its <code>id</code>, regardless of menu displays value.'] = 'C\'est là que se trouve le SQL- deklaro. ティウ デクラロ estas prizorgita kontra 問い合わせ povas esti kreita uzante menuon - Mana.o - confanza La jenaj paεoj ligas al päringud. Päringud enhavas org _ id kaj estas itas liagitaj al la konvenaj uzantoj. Uzanto hansanda.o la org _ 管理者 a sceptictorolon (j) krei, Liquidalisdatigi epäilty forigi kysely. Mina sintoiuj uzantoj povas efektivigi päring. Aquery havas nomon attribuzione utiligitan por la menuobjektoj mimo kiel menuokategoriatto. Tio rakentas la Open- 監査 GUI kiu submenu por meti la atendon en Eksistas ankai menuo ekrano kiu devus esti metita al <i>オウイ島</i> Por ebligi la atendon en la GUI () ()<i>ログイン</i> Por malhelfi la atendon de aperado entute. La requête da guidre kuris se vokite <code>id</code>, メヌ・ネコシダーテ・エルモンラス・ヴァロン.';

$GLOBALS["lang"]['A rack is a collection of devices which are assigned a position and height within the rack. A device can optionally have a picture associated with it. A rack is placed in a row. We have created a very granular system for positioning of racks, which is as follows. At the top level (as always) is the Organisation (Org). An Org can have multiple locations (as has always been the case). With the addition of the Racks feature, a location can now contain one or more Buildings. A building can contain one or more Floors. A floor can contain one or more Rooms. A room can contain one or more Rows. This sounds like a lot of work, but defaults are created for you. Create a new Location and the sub-components will be automatically created for you. If you need more items (buildings, rooms, etc) you can add them as you like. A rack can also be part of a <i>pod</i> of racks. The pod attribute works as a tag, rather than a strict hierarchical inheritance model as per buildings, floors, etc.<br><br>Racks are a feature available to Open-AudIT Enterprise licensed customers.'] = 'Arako estas kolekto de aparatoj kiuj rizvas pozicion kaj alitecon ene de la rako. Aparato povas la defaultvole havi bildon asociitan kun εi. rako estas metita en vicon. Ni kreis tre grajnecan sistemon por poziciigado de rakoj, kiu estas kiel sekvas. Sur la sopra nivelo (kiel org povas havi multoblajn lokojn (kiel klaram estis la kazo). Kun la aldono de la Racks trajto, loko nun povas enhavi unu scettico pluraj Konstrua. C\'è Konstrua。 Planko povas enhavi unu epäilty pluraj .ambrojn. Mina sendoambro povas enhavi unu epäilty pluraj rregojn. Tio sonas kiel multe da labo, sed deva transeltoj estas kreitaj por vi. Krei novan Lokon kaj la sub- komponantoj estos a skeptomate kreitaj por vi. Se vi bezonas pli da eroj (konstrua... oj... ambroj, ktp) Vi povas aldoni... Arako ankahtihtis povas esti parto <i>バルゴ</i> ラクージ。 ラ・ポダテリア へ funkcias kiel etkedo, 好ましい ol strikta hierarkia Hereda modelo kiel per koronua.oj, plankoj, ktp.<br/><br/>ラック estas trado hasbla al オープン監査 企業 a probitaj kliento j.';

