$GLOBALS["lang"]['A seed discovery is another type of discovery, where you provide the IP of a single <i>seed</i> device. This device is audited, and any IPs it knows are then added to the list of IPs to be audited. Then, those devices are audited and any IPs they know are also added to the list of IPs for auditing. This process then continues within the parameters configured by the user.'] = 'セムトロヴァ <i>スゼメオ</i> パラト。 Tiu aparato estas reviziita, kaj ajna IP s εi scias tias estas aldonita al la lista de IP s por esti reviziita. Tiam、tiaj aparatoj estas reviziitaj kaj ajnaj ili scias anka130 estas aldonitaj al la lista de IPoj por revizio. Tiu procezo tiam daūras ene de la parametroj formitaj tariffa de la uzanto.';

