$GLOBALS["lang"]['A storage area network (SAN) is a dedicated network that provides access to consolidated, block level data storage. SANs are primarily used to make storage devices, such as disk arrays, tape libraries, and optical jukeboxes, accessible to servers so that the devices appear like locally attached devices to the operating system. A SAN typically has its own network of storage devices that are generally not accessible through the local area network by other devices. The cost and complexity of SANs dropped in the early 2000s to levels allowing wider adoption across both enterprise and small to medium-sized business environments.'] = 'Stoka isoreto (SAN) estas officicia reto kiu disponigas aliron al fericita, blok- nivelaj datentokado. サン・ティペ・ハヴァス・シアン・プロパン・レトン・デ・ストカダパラトジ・テスタ・リコネルレ・ネ・アテリオブラジ・トラ・ラ・ロカ・アレレト・デ・エイリアスジ・アパラトジ La kosto kaj komplekseco de SANoj falis en la fruaj 2000- aj jaroj al niveloj permesantaj plil lar rupturaan adozione trans kaj entrepreno kaj malgrandaj al mezgrandaj komercedioj.';

$GLOBALS["lang"]['A string that matches the <code>software.name</code> attribute. You can use the standard SQL wildcard of percent (%) to match one or more characters.'] = 'アコルドキウ egalas <code>software.name</code> Tisztelet。 Vi povas uzi la norman SQL- sovaεan karton de procentoj (%) por egali unu デフォルト pluraj karakteroj.';

