$GLOBALS["lang"]['Below you can see an example Org Chart. If a user has permission on the <i>Finance A</i> Org, they also have permission on the descendant Orgs of Dept A, B & C. This is regardless of the collection requested.<br><br>If the collection requested allows ascendants, then the user will also have access to Company #1 and Default Org items. This is for (as above) queries, groups, et al.<br><br>Note - A user may have access to a query from Default Org, but that is the query itself not the result. The result will only show devices that the user has access to - IE devices from Finance A and Dept A, B & C.'] = 'Malsupre vi povas vidi ekzemplon Organigramma. Le Conseil de l\'ヨーロッパ <i>フィンアンコ</i> - C\'è l\'est quoi? havas permeson sur la posteulo. オラグスデパートA、B&C Tio estas nekonsiderante la kolekto petis。<br/><br/>Se la kolekto petis permesas aspintojn, tiam la uzanto anka epäilty havos aliron al soro 1 kaj Oletus org erojn. Tio estas por (kiel supre) requestoj, grupoj et al.<br/><br/>Notu: uzanto povas havi aliron al demando de Alapértelmezett Org、seditio estas la atendo mem ne la rezulto. La rezulto nur montras aparato kiujn la uzanto havas aliro al - IE aparatoj de ファイナンス a kaj 部門 A, B & C';

