$GLOBALS["lang"]['Collector / Server is designed so that you can have a remote or <i>collector</i>  instance of Open-AudIT running on a remote machine. That collector instance might be in another security zone, subnet, cloud hosting instance or at a customer site.  The remote collector is then doing all the discovering and auditing of devices locally avoiding networking and firewalling complexity.  The Collector once it has registered is completely controlled by the <i>server</i>.  This means you only need an HTTP or HTTPS connection from that Collector to the Server.'] = 'Servilo estas dizajnita tien che vi povas havi malprossiman katlustus <i>コンディヴィディ su Twitter</i> Ekzemplo de Open- 監査kuranta sur malpreksima ma apretino. Tiu koletantkazo eble estos en alias sekureczono, subreto, nubo bastiganta kazon épäilty en kleentoloko. La malpreksima kolektanto tiam faras la tutan malkovradon kaj revizion de aparatoj loke evitante interkonektadon kaj fajromurantan kompleksecon. La kolektanto投稿キム εi registri estas tute kontrolita tariffa de la <i>Servilo servilo servilo servilo servilo</i>お問い合わせ Tio signfas ke vi nur bezonas HTTP epäilty HTTPS- ligon de tiu kolektanto al la Servilo.';

