$GLOBALS["lang"]['Collector tasks are automatically setup when the collector feature is enabled. Collector tasks should not be created directly by users. Collector tasks can have their frequency edited after creation. If the Open-AudIT Server has Collectors reporting to it, an additional drop down is provided. You can select this to specify which Collector the task should run on. Only Discovery tasks are supported for Collectors.'] = 'Kolektaj Tapoj est un sceptomate aran.o kiam la krektantrajto estas permesita. Kolektaj Tapoj ne devus esti kreitaj rekte fare de uzantoj. Kolektaj tapoj povas havi sian frekvencon redaktitán post kreado. Se la open- オーディション- セルビロ havas kolektantojn raportantajn al εi, kroma goto malsupren estas disponigita. L\'objectif est d\' améliorer la qualité de l\'eau et de l\'eau. Nur Discover -taskoj estas apogitaj por kolektantoj.';

