$GLOBALS["lang"]['Each IP is scanned with the discovery configured options (see Discovery Scan Options and Discovery - Community vs Professional vs Enterprise on the wiki). In general, Nmap will test for ports 22 (ssh), 135 (wmi), 62078 (iPhone) and UDP 161 (snmp). If 22, 135 or 161 respond the credential list is retrieved and each credential tested in turn. The first working credentials are used for further queries directly from the device. Note - if a device has previously been discovered and has working credentials, those credentials are tested first. Only if those fail are the other credentials then attempted.'] = ' imitaiu IP estas skanita kun la eltrova.o formita opcioj (vidu ディスカバリー スキャン オプション kaj ディスカバリー - komuno 対 プロフェッショナル 対 企業 sur la Vikio). Se 22, 135 a. 161 risposta 来る la lurkliston estas prenita kaj La uuaj laborakredita.oj estas uzitaj por pliaj demandoj rekte de la aparato. ノチュ - se aparato anta Nur se tiaj malsukcesas estas la aleliaj akreditaj tiam providontaj.';

$GLOBALS["lang"]['Each time a device is discovered or an audit result is processed, all rules are retrieved from the database and run against the attributes of the specific device. Rules run against one device at a time - there is no facility to say <i>Run the rules against all devices<i> or <i>Run the rules against these devices<i>. An individual rule will test one or more attributes of the device and if they match the rule, the result will be applied. Several attributes can be tested. Several attributes can be set. Think of this as an If This, Then That system for Open-AudIT.'] = 'Mezcla de este aparato esta malkovrita a reviziorezulto estas prilaborita, Regeloj kuris kontra epäilty unu aparato en tempo... <i>ラ・レグロジ・コントラ Iuj パラトイ<i> ツイート <i>ラ・レグロジ・コントラ<i>お問い合わせ Personuopregico tetos unu a rezulto estas aplikita. Pluraj atregultoj povas esti recontaj. Pluraj atregultoj povas esti mititaj. Pensu privio kiel Setio, tiam tium tiu sistemo por オープン 監査.</i></i></i></i>';

