$GLOBALS["lang"]['If you enable the configuration item, use discovery to assign an Org and then subsequently change the OrgID of a device after discovery then you will likely have a new device created the next time the discovery runs. In this instance, you should probably just unset devices_assigned_to_org before running subsequent discoveries. This is because (in this instance) you have told Open-AudIT <i>these devices from this discovery belong to Org X<i>, but then changed the Org of the device. You have changed the stored devices information. In this case - there is no no longer a device belonging to Org X, so we create a new one.'] = 'Se vi rajtigas la konfiguracion, uzu eltrova ... Org kaj tiam poste шанннний la OrgID de aparato post eltrova.o tiam vi ver apretajne havos novan aparaton kreis la venontan fojon la eltrova.o kuris. Entiu kazo, vi devus ver diverraajne nur neselektitaj aparatoj ... prizorgado de postaj eltrova ... Tio estas clar (en tiu kazo) vi rakontis al 公開 - 監査 <i>Tiuja paratoj de tiau eltrova.o apartenas al org X<i>Sed tiam ラ ラグ・デ・ラ・パラト。 La stokitajn aparatojn インフォア。 En tia kazo, ekzistas jam ne aparato apartenanta al org X, tiel ke ni kreas novan.</i></i>';

