$GLOBALS["lang"]['In the case of <code>in</code> and <code>notin</code>, you should enclose the values in round brackets and separate them using a comma (just a comma, not a comma, then space).<br><br>With these operators you can filter quite comprehensively.<br><br>When you add data and filter on multiple columns, those columns are combined using <strong>AND</strong>. You cannot filter using an <strong>OR</strong> condition. With the inclusion of <code>notin</code>, you should be able to get most searches working. And for those that do really require unsupported and complex selections, you can always write an actual query.'] = 'ツイート アンラカゾデ <code>in</code> カジ <code>notin</code>Vi devus fermo la valorojn en rondaj krampoj kaj apartigi ili uzante komon (nur komo, ne komo, tiam spaco).<br/><br/>Kun tiau funkciigistoj vi povas filti tre amplekse.<br/><br/>Kiam vi aldonas datenojn kaj instalilon sur multoblaj kolonoj, tiaj kolonoj estas Kombintaj uzante <strong>カジ・カジ</strong>お問い合わせ L\'Unione ユーロペエンヌ <strong>ツイート</strong> C\'è Kandičoさん。 クン・ラ・インクルード <code>notin</code>L\'objectif est de faire en sorte que l\'ense de la people soit en mesure d\'attecindre ses objectifs. Kaj por tiauj kiuj vere postulas nepruvitajn kaj kompleksajn selektadojn, vi chiam povas skribi faktan atendon.';

