$GLOBALS["lang"]['On Windows, Open-AudIT uses WMI as it is primary method of auditing. Windows has a notorious reputation where remote WMI is concerned. It tends to either <i>just work</i> or some mystery item on the target requires changing. If you are experiencing difficulty auditing remote Windows PCs, we have created a script called test_windows_client.vbs. You can run this script <strong>locally</strong> on the machine in question, after signing on as the user that is used by Open-AudIT to perform the audit. The script makes <strong>no changes</strong> to the target devices. It checks most (not all) of the items below and generates PASS, FAIL and INFO tags for various properties. NOTE - If your target system is being audited correctly, you should not change any settings. Some of the below do not exist on Windows PCs that are able to be audited and some do exist. Only change settings if your discoveries on particular PCs are not working as intended.'] = 'Sur Fenestroj、Open-監査utiligas WMI kiam εi estas primara metodo de reviziado. Fenestroj havas konatan reputazione kie malpreksima WMI estas maltrankvila. Ma kaldun kaplustama (マ カルドン kaplustama) <i>Nincs マギール ネーヴ</i> ツイート Se vi spertas malcomediecon reviziantan malpreksimajn Fenestrojn, ni kreis manikripton nomitan testwindows _ client.vbs. ヴィオ・ポワス・クリ <strong>トルタ</strong> En la ma apretino preoccupazioneita, ポスト subskribado kiel la uzanto kiu estas utiligita fare de open- 監査 por elfari la revizion. La maniskripto ファラス <strong>ネニウ・グリテノスイ</strong> ラ・セラパラトジ Se através de celsistemo estas reviziita εuste, vi ne devus дерни анои jujn ajn 前rdojn. Kelkaj el la malsupre ne ekzistas sur Fenestroj kiuj povas et reviziitaj kaj kelkaj eksistas. Sur specialaj Komputiloj ne funkcias kiel celite.';

$GLOBALS["lang"]['On the Tasks List page, click the <i>Add New</i> button to configure a task.'] = 'Sur la ülesanded Nimekiri paεo, klakas la <i>アルドン・ノヴァン</i> バトノ por 前に rdi ülesanne.';

$GLOBALS["lang"]['On the field <i>Match String</i> you should provide the name of the software that you want to track. You can use the percent sign (%) as a wildcard in where required.'] = 'Sur la kampo(スララ) <i>シエール・デ・パティード</i> Vi bruts providoni la nomon de la programmaro, kiun vi volas printi. Vi povas uzi la procentan signon (%) kiel sova quallyan karton en kie necesse.';

