$GLOBALS["lang"]['Once those initial queries (snmp, ssh, wmi) are complete, if the device is a supported by the audit scripts (Windows, Linux, OSX, AIX, HP-UX, Solaris and ESXi), the correct audit script will be copied to the target and executed. The audit script will self delete upon completion. The result will be stored on the target machine as an XML file. The Open-AudIT server will then retrieve the result file for processing and delete the result file on the target. The location the audit script is copied to on the target device (at least for SSH audits) is configurable by editing the discovery_linux_script_directory config item. By default it is set to /tmp/. This may need changing if /tmp has noexec set. The result file is then processed and the device details updated within Open-AudIT.'] = '投稿 キアム tiaj omencaj esigeoj (snmp, ssh, wmi) estas kompletaj, se la aparato estas apogita per la reviziomanuskriptoj (Windows, Linukso, OsX, HP-UX, Solaris kaj ESXi), la εusta reviziomanuskgita estos koopi La revizio manikripto mem forigos sur kompletigos. La rezulto estos stokita sur la celma apretino kiel XML- dosiero. La Open- オーディション- servilo tiam prenos la rezultan dosieron por pretigo kaj forigi la rezultan dosieron sur la celo. La loko kiun la reviziomanuskripto estas kopita al sur la celaparato (almena support por SSH-revizioj) estas formita redactante la eltrova.o _ linux _ スクリプト _ rektan konfikobjekton. L\'ution de l\'énergie nucléaire dans le secteur de l\'énergie et de l\'énergie, y compris l\'énergie et l\'énergie énergie Tio povas bezoni рan La rezulta dosiero tiam estas prilaborita kaj la aparato detaloj εisdatigitaj ene de';

$GLOBALS["lang"]['Once you click the execute button, Open-AudIT will spawn a process to initiate the discovery and return the user to the discovery details page. The newly spawned process takes the configured discovery options and executes Nmap commands to determine the initial list of IP addresses to be scanned (or queries Active Directory if that type is used). Each IP to be scanned is placed into a queue. Once the initial process has completed (and there are IPs to be scanned in the queue) a number of processes will be spawned to further scan each IP in parallel. This number of processes is configurable in the configuration, edit the attribute <i>queue_limit</i>. By default this is set to 20.'] = 'ポストキム・ヴィ・クラカス・ラ・フェクチタン・ブロン, オープン 監査 suvut procezon por iniciati la eltrova ラ lastatempe generita procezo prenas la formitajn eltrova.oelektojn kaj efektivigas Nmap komandojn por determini la omencan Listan de IP- adresoj por esti skanitaj (kahtlusega demandoj Active Directory se tiu tipo estas uzita). Imitaiu IP esti skanita estas metita en atendovicon. Poste kiam la omenca procezo kompletigis (kaj ekszentas IPoj por etisti skanita en la atendovico) kelkaj procezoj estos generitaj al plu skana... Tiu nombro da procezoj estas konfumbla en la konfiguracio, redakki la attributeon. <i>Järjekorra _ リマ</i>. deca.lte tio estas metita al 20.';

$GLOBALS["lang"]['Once you have chosen your devices to edit, click the pencil button on the top right of the table.'] = 'Poste kiam vi elektis viajn aparatojn redakki, klaki la krajonon sur la sopra rajto de la tabla.';

$GLOBALS["lang"]['Once you have done this, Open-AudIT will attempt to verify your user logon details against the configured Auth Method. If the user has valid credentials and <code>use_authorisation</code> is set, Open-AudIT will ask for the list of groups that the user belongs to. If the user is in the corresponding groups for Open-AudIT Roles and Orgs, those Roles and Orgs will be applied to that user.'] = 'キム・ヴィ・ファリストン、オープン・レイト・プロヴォ・コンフィルミ viajn uzantemblemojn detalojn kontra. Se la uzanto havas valajn akredita <code>use_authorisation</code> Estas meetita, オープン監査 petos la listan de grupoj kiujn la uzanto apartenas al. Se la uzanto estas en la ekvialentaj grupoj por Open- 監査 Roloj kaj Orgs, tiaj Roloj kaj Orgs estos aplikitaj al tiu uzanto.';

$GLOBALS["lang"]['Once you have generated a Baseline Definition you can schedule it to be run against a specified group of devices.'] = '投稿 キアム vi generis Bazlinio- Difinon vi povas plani liukoinen por esti prizorgita kontra epäilty perozigita grupo de aparatoj.';

