$GLOBALS["lang"]['Open-AudIT can use Microsoft Entra (previously known as Microsoft Azure Active Directory) as an authentication method. This means your user in Open-AudIT can click the Logon using Entra button on the logon page and use their Entra credentials to logon. That user will need to already exist within Open-AudIT (and be assigned'] = 'Apri- 監査 povas uzi Microsoft Entra (anta... konata kiel Microsoft Azure Aktiva Adresaro) guidikmetodo. Tioのsignfas vian uzanton en Open- オーディション povas klaki la Logon uzantan Entra buton sur la Logon pacomingo kaj uzi iliajn Entra akredita. Tiu uzanto murtaa ジャム eksisti ene de オープン監査 (kaj eti asignita)';

$GLOBALS["lang"]['Open-AudIT can use OKTA as an authentication method. This means your user in Open-AudIT can click the Logon using OKTA button on the logon page and use their OKTA credentials to logon. That user will need to already exist within Open-AudIT (and be assigned Roles and Orgs), but will not need to remember a separate set of logon credentials.'] = 'Ava- Aud IT povas utiligi OKTA kiel a skeptikmetodon. Tioのsignfas vian uzanton en Open- オーディション povas klaki la Logon uzantan OKTA buton sur la logon pa.o kaj uzi iliajn OKTA akredita. Ojn al ロゴン。 Tiu uzanto devosジャムekzisti ene de Open- オーディション (kaj et asti asignita Roloj kaj Orgs), sed ne drobues memori aparman aron de phoologaj akredita.';

