$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an <code>org_id</code> column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = 'Open- Aud IT- sortipoj kun enkertuitaj roloj por admin, org _ admin kaj uzanto.<br/><br/>Enerale, uzanto kiu estas amministrazione de la Open- 監査 aplika.<br/><br/>Uzanto povas havi plurajn rolojn. La permeso estos sur varamirita sur la plej persisiva nivelo - IE, se uzanto havas la rolojn de uzanto kaj org _ 管理者, ili povos krei lokojn clarar org _ 管理者 donas tiun perseson, e preveía se la uzantrolo ne faras.<br/><br/>La admin rolo permesas aliron al kolektoj kiel ekzample konfiguracio, datumbazo, grupoj, ldap serviloj, tagaloj, requestoj kaj roloj. Tutmondaj eroj kiuj befolyásolja la tutan aplikon.<br/><br/>La org _ 管理者 rolo kutime permesas krei, legi,. プラクティック <code>org_id</code> クロノ。<br/><br/>ラ・ズントロロ... Enerale permesas legi nur aliron al...';

$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an org_id column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = 'Open- Aud IT- sortipoj kun enkertuitaj roloj por admin, org _ admin kaj uzanto.<br/><br/>Enerale, uzanto kiu estas amministrazione de la Open- 監査 aplika.<br/><br/>Uzanto povas havi plurajn rolojn. La permeso estos sur varamirita sur la plej persisiva nivelo - IE, se uzanto havas la rolojn de uzanto kaj org _ 管理者, ili povos krei lokojn clarar org _ 管理者 donas tiun perseson, e preveía se la uzantrolo ne faras.<br/><br/>La admin rolo permesas aliron al kolektoj kiel ekzample konfiguracio, datumbazo, grupoj, ldap serviloj, tagaloj, requestoj kaj roloj. Tutmondaj eroj kiuj befolyásolja la tutan aplikon.<br/><br/>La org _ 管理者 rolo kutime permesas krei, legi,. プラクティック <br/><br/>ラ・ズントロロ... Enerale permesas legi nur aliron al...';

$GLOBALS["lang"]['Open-AudIT ships with several pre-configured Dashboards. If you are a Professional user, you can select between two of these and set it as your default page when you logon. If you are an Enterprise user, you can not only select between the five preconfigured Dashboards, but you also have the ability to create your own.'] = 'Ouvrir 監査 - apretipoj kun pluraj anta.- konfiguritaj Armatuurlau. Se vi estas Profesia uzanto, vi povas elekti inter du el tiauj kaj meti εin kiel ビア dea guidlta pa clearficao kiam vi ロゴン. L\'entreprisuzanto, vi ne povas nur selekti inter la kvin anta.konfiguritaj Tableau de bord, sed vi anka... havas la kapablon krei vian propran.';

