$GLOBALS["lang"]['Open-AudIT uses Nmap in its Discovery function. Nmap probes devices for open ports. Devices ideally should respond with open for working ports. Devices often do not respond with this. The varying responses are detailed below.'] = 'Apri- 監査 Uzas Nmap en Žia Discopy- funkcio. Nmap sondid aparatoj por malfermaj hasnoj. Destinivos idéale devus responsi kun malferma por laborhavenoj. Il s \'agit d\' une réaction de type al tio. La réponseoj estas detalaj malsupre.';

