$GLOBALS["lang"]['Our goal with the initial integrations release was specifically for NMIS to Open-AudIT integration to <i>just work</i>. If you are using the programs on Linux, you can literally click a single button to execute the integration. Nothing more is required. Having said that, the integration itself is extremely configurable - so if something is not to your preference, it can easily be changed.'] = 'Nia celo kun la omencaj integri / 1993 / oj estis spécifife por NMIS al オープン監査 Integrai Fluido al オープン監査 <i>Nincs マギール ネーヴ</i>お問い合わせ Se vi uzas la programmojn sur Linukso, vi povas la difettovorte klaki unu buton por efektivigi la integriεon. Nenio pli estas bezonata. Diris ke, ラ・インクルーシブ';

$GLOBALS["lang"]['Our new feature called Vulnerabilities gives you the ability to quickly determine if any devices are affected by any CVE (Common Vulnerability Exposure) - but how?<br><br>FirstWave constantly consumes the output from the Nist NVD feed. We take this and apply a few restrictions, then extract the affected programs and build a SQL query for reporting. Your Open-AudIT instance reaches out to FirstWave and requests any new vulnerabilities on a regular basis. When it receives a new vulnerability record, it is run against the database and the result stored. Each time a device is processed, all matching vulnerabilities are again executed and the result stored. This means when viewing a vulnerability list, we do not need to calculate all affected devices - we already have the result. When you view an individual vulnerability record, we do indeed recalculate the result for this singular vulnerability.<br><br>So, you are always up to date!<br><br>In addition to this, we also calculate the result of all vulnerabilities for all devices daily (usually at a quiet time, say 2am).<br><br>In your instance of Open-AudIT, we allow you to select which vendors you care about. i.e. there is no use retrieving vulnerability records from a vendor whose software you do not use or have installed. By default, our vendor list is Adobe, Apple, Cisco, Google, Microsoft, Mozilla, and Redhat.<br><br>This all sounds very simple, but behind the scenes a <b>lot</b> is going on. For instance, the CVE record contains a list of affected software - but those software names do not match what we receive when we audit a computer. A good example is Apache. Typically, a CVE record will say the affected software is http_server. In reality, this appears as apache2 (Ubuntu), httpd (Redhat), Apache HTTP Server (Windows) - and others. So, we have to first determine what is the actual name of the program we receive when we ask a computer, and there may be multiple names. After that we must parse the CVE record and create a matching SQL statement. Allowing for multiple program names as above, and multiple versions, version ranges, and even multiple different pieces of software (an example is Thunderbird and Firefox in a single CVE). And your instance of Open-AudIT must take this and apply Orgs filtering as well. And that is just a single CVE. What about determining which CVEs you have and do not have? What about adding a vendor to the list later? So many things to consider!<br><br>As well as the usual reporting, we also have a few new widgets available for Dashboards, based on Vulnerabilities data.'] = 'Nia nova trajto nomita ノミタ Haavavus donas al vi la kapablon faste determi ... uija paratoj estas trafitaj fare de iu CVE (Komuna haavatavuse kokkupuude) - sed kiel?<br/><br/>Première Onda konstante konsumas ラ produkta Ni prenastion kaj aplikas kelkajn restriktojn, tiam eltiras la trafitajn programmojn kaj konsturas SQL-デマンド por raportado. オープン監査 - kazo atingas al firstWave kaj petas jujn novajn vundingblecojn surregia batso. キム εi rizvas novan vundeblecon, εi estas prizorgita kontraluc la datumbazo kaj la rezulto stokita. Parato imitaiun fojon estas prilaborita; Egalaj vundeblecoj noveeri besoin efektivititaj kaj la rezulto stokita. ティオ・サインファス・デュム・スプエカド・ド・ヴァンデンブルコリスト、ニ・ネ・ベゾナス・カルクリ・.iujn trafitajn aparatojn - ニ・ジャム・ハヴァス・ラ・レズルトン。 Kiam vi rigardas indiguan vundeblecon, ni efektive rekalkulis la rezulton por tiu eksterordinara vundebleco.<br/><br/>クラリアム estas εis nunna!<br/><br/>Aldone al tio, ni ankarealkalkulas la rezulton de... iuj vundeblecoj po...<br/><br/>En kautta kazo de Open- 監査, ni permesas al vi selekti jiu vendistoj vi zorgas. St ekzistas neniu uzo prenante vundebleediskojn de vendisto kies softvaro vi ne uzas a skeptis. Deta.lte、nia vendristo listas Adobe、Apple、Cisco、Google、Mikrosuto、Mozilla、Kaj Redhat。<br/><br/>ツイート <b>オマ・マルテ</b> アイル。 Ekzample、La CVE rekordo enhavas listan de trafita softvaro... Sed tiaj softvarnomoj ne egalas kion ni rizvas kiam ni revizias kompution. Bona eczempo estos Apache がリリースされました。 Tipe、CVE rekordo diros ke la trafita softvaro estas http _ serviur. Fakte、tio prezentipriasキエルapache2(Ubuntu)、httpd(Redhat)、Apache HTTP-palvelin(Windows) - kajilishij。 Ni tuhoaa unue determini kio estas la fakta nomo de la programmo kiun ni risovas kiam ni demandas kompution, kaj povas eksisti multoblaj nomoj. 投稿者 tio ni murtaa alazi la CVE- rekordon kaj krei egalan SQL- deklaron. Permesado por multoblaj softvaro (ekzemplo estas Thunderbird kaj Firefox en ununura CVE). kazo de Open- 監査 tuhoa preniition kaj apliki Orgs filtradon ankadon. Kaj Tio estas nur ununura CVE. Kion vi havas kaj ne havas? Kion aldoni vendiston al ラ リストア poste? Multaj aferoj por pripensi!<br/><br/>Mismo kiel la kutima raportado, ni anka. havas kelkajn novajn vidinad havblajn por Dashboards, surbaze de Vulnerability datenoj.';

