$GLOBALS["lang"]['Recently we have been asked the question - do you consider Open-AudIT more secure than other similar programs? As with most things, the answer is <i>it depends</i>.<br><br>Open-AudIT can be operated in such a way as to be extremely secure. But as usual with computer-based security, the more secure you wish to make something, the more inconvenient it becomes to use. The old phrase <i>the most secure computer is one that is turned off and in the cupboard<i> comes to mind.<br><br>Below we will outline some options that can be used with Open-AudIT that will increase security. Like most items within Open-AudIT, these are options and not mandatory. How far you take security is up to you.'] = 'Licatempe niestis esigeitaj la demando -... u vi konsidras Open- AudIT pli sekura oleelij simpiaj プログラムmamoj? Kiel kun la pléj utilij aferoj, la responsabilité estas <i>ソルトレーン</i>お問い合わせ<br/><br/>Ava- Aud Povas esti funkciigita la epäilty tia maniero kiel por esti ekstreme sekura. Sed kiel kutime kun kompution- bazita sekureco, la pli sekura vi deziras fari ioni, la pli malkonvena εi iεas uzi. ラ・マルノバ・ブラートソ <i>La pléj sekura komputilo estas unu kiu estas malakceptita kaj en la рranko.<i> ヴェナスアルメンソ。<br/><br/>Malsupre ni skizas kelkajn opciojn kiuj povas et uzitaj kun Open- 監査 kiu pliigos sekurecon. Kiel la pluj utilej eroj ene de オープン 監査, tiuj estas opcioj kaj ne devigaj. Kiom vi prenas sekurecon estas εis vi.</i></i>';

