$GLOBALS["lang"]['Setting up Discovery on a subnet is almost identical to running a regular Discovery via the web interface. The only additional items are the scheduled hour and day(s) and a name for the Scheduled Task itself. You can take advantage of this to schedule multiple discoveries using different sets of credentials.<br><br>As per the Subnet Discovery, the Active Directory Discovery is also simply the same fields as a regular Active Directory Discovery with the addition of a day, hour(s) and name.<br><br>If the Open-AudIT Server has Collectors reporting to it, an additional drop down is provided. You can select this to specify which Collector the task should run on. Only Discovery tasks are supported for Collectors. Specify the same items as a regular Discovery, but provide the alternate Collector to run this task.'] = 'Condividi su Google Discovery sur subreto estas preskalucir identa al prizorgado dérégmentation Discovery per la interretinterfaco. La nuraj kromaj eroj estas la planita horo kaj tago (j) kaj nomo por la Planita Tasko nem. Vi povas ekspluatition por plani multoblajn eltrova<br/><br/>Kiel per la Subnet Discovery, la Aktiva Adresaro Découverte anka epäilty estas yksinkertainen la samaj kapoj kielregula Aktiva Adresaro Découverte kun la aldono de tago, horo (j) kaj nomo.<br/><br/>Se la open- オーディション- セルビロ havas kolektantojn raportantajn al εi, kroma goto malsupren estas disponigita. L\'objectif est d\' améliorer la qualité de l\'eau et de l\'eau. Nur Discover -taskoj estas apogitaj por kolektantoj. Spektu la samajn erojn keileregator Discovery, sed disponigas la changan kolektanton por prizorgi tiun tasmon.';

