$GLOBALS["lang"]['So you have an issue providing Open-AudIT credentials to discover your devices. I have an answer - dont then! Sure, I mean, discovery is the best thing since sliced bread. You do not need to know ahead of time <i>Whats On Your Network</i>. But how can you extract data from devices without providing credentials?<br><br>In the case of computers, an easy option is to copy the appropriate audit script to the target machines and set it to execute on a schedule. More details on the wiki. The machines will send their data to Open-AudIT on that schedule, almost as if you were running discovery. The device simply runs the audit script on a schedule (again, you can read the audit script) as the user you tell it to and sends the output to the server. No credentials are involved at all.<br><br>And now we have Agents for Windows. The advantages of an actual installed Agent are'] = 'Tiel vi havas temon disponigantan オープン監査 kredita.ojn por malkovri viajn aparatojn. Mi havas responsonon - ネプル! Mi pensas, ke malkovro estas la pléj bona a.o ekde tran. ヴィ・ネ・ベゾナ・スカイ・アンタルク <i>Kio estas sobre ビア リト</i>お問い合わせ Kiel vi povas eltiri datumojn de aparatoj sen providoni akredita と...<br/><br/>Koncerne komputilojn、rifiuti opcio dedes kopii la konvenan reviziomanuskripton al la celma negociainaj kaj meti εin por efektivigi horaron. Pli da detaloj sur ラ Vikio. La ma apretinoj sendos siajn datumojn al Open- 監査 en tiu horaro, preska La aparato semplicemente prizorgas la reviziomanuskripton en horaro (deno, vi povas legi la reviziomanuskripton) kiel la uzanto vi rakontas εin al kaj sendas produkta. Neniuj akredita.oj estas implicitaj entute.<br/><br/>Nun ni havas agenteojn por Vindozo. ラ・アバンタ・ピラオジ・デ・ファクタ・ヒステリタ・ハリソ・エスタス';

