$GLOBALS["lang"]['Sometimes agentless discovery just does not fit your use-case. Maybe your PCs have tight firewalls. Maybe they are not on the network when your discoveries are scheduled. Maybe they are used by remote workers. Whatever the case, this is where an agent can help. Install it on the target machine and it will <i>check-in</i> with your Open-AudIT server on a schedule and accept tasks. The most common task the server requests is for the agent to audit itself and send the result.'] = 'Foje sensle ... une eltrova ... ne konvenas luun uzon. Eble via komputio havas striktajn fajromurojn. Eble ili ne estas en la reto kiam viaj malkovroj estas planitaj. Ili estas uzataj de malpreksimaj laboristoj. キオ ajn estas, tio estas kie agenteo povas helpi. Instali εin sur ラ celma apretino kaj <i>コントロールイン</i> Kun via Open- 監査- servilo en horaro kaj akceptas takojn. La pléj の tako la servilpetoj estas por la agento por revizii 罪 kaj sendi la rezulton.';

