$GLOBALS["lang"]['The collector is essentially a full install of Open-AudIT in <i>collector</i> mode. The collector is designed to run discovery upon the network it is situated in. It is not restricted to only that network, but ideally it would essentially be one collector per subnet where required. The collector is driven on a schedule by the server and runs discovery upon the network as specified.<br>When in Stand Alone mode the Collector acts as an independant server, simply forwarding all devices found to the main server.<br><br>Once installed and setup, control of the Collector is performed on the Server (not in Stand Alone mode).<br><br>The only required network ports between the collector and server are 80 or 443 (TCP connection established from the Collector to the Server). The Open-AudIT database is not (and cannot be) shared between these installs.<br><br>By default the collector (not in Stand Alone mode) will request from the server any discovery tasks every 5 minutes (you can configure this on the server for new Collectors using the configuration item collector_check_minutes) therefor any discovery tasks for the collector should be scheduled for 0, 5, 10, 15, etc minutes.'] = 'La kolektanto estas esence pena secretaoo de Open - 監査 fr <i>コンディヴィディ su Twitter</i> デヌエボ。 La kolektanto estas dizajnita por prizorgi eltrova. sur la reton kiun εi estasituanta en. sedi ne estas limigiita al nur tiu reto, sed idéale εi esence estus unu kolektanto per subreto kie nesse. La kolektanto estas movita en horaro fare de la servilo kaj prizorgas eltrova<br/>Kiam en la Sola reprimimo la kolektanto funkcias kiel endelica servilo, semplicemente plusendi <br/><br/>ポストのcontrolo de la kolektanto estas farita sur la Servilo (n en stand Alone- re.imo).<br/><br/>La nuraj postulataj sendostaciaj hasnoj inter la kolektanto kaj servilo estas 80 kaptlus 443 (TCP- ligo establita de la kolektanto εis la Servilo). La Open- 監査 datumbazo ネ estas (kaj ネ povas esti) distita インター tiuj インストーラー.<br/><br/>deca... lte la kolektanto (nm disponible en stand Alone) - s s s s';

