$GLOBALS["lang"]['We are often asked this question and the answer most definitely is <i>it depends</i>. It depends on the number of IPs to be scanned, the network connection speed, the speed of the devices being scanned, the type of devices being scanned, the number of different credentials being tested and the speed of the Open-AudIT server. We do not have a calculator that would allow us to input those variables and return a value. It is simply too complex. Generally I limit my discoveries to 256 IP addresses - ie, a /24 subnet. We have had customers scan /16 subnets (65k addresses) and it does work - but it can take a long time. You are much better off scanning in /24 blocks. If you simply do not know what your address ranges are, then this is a good case for a Seed discovery.'] = 'Ni oarte domanda di rilancio kaj lareaktiono pléj sendube estas <i>ソルトレーン</i>お問い合わせ Tämä asetus sur kaikilta osiltaan velvoittava, ja stera sovelletaan Sellaenaan kaikissa jäsenvaltioissa. Ni ne avas kalkulilon kiu permesus al ni enigi tiujn variablojn kaj rendi valoron. Estas トロ kompleksa. Ni havis klientojn skani/16 subretojn (65k adresoj) kaj εi funkcias - sed εi povas preni longan tempon. Il s \'agit d\' un programma di formazione à l\'intendation des jeunes. Se vi semplicemente ne scias, kion viaj adresaroj estas, tiamtio estas bona kazo por seita malkovro.';

