$GLOBALS["lang"]['We initially setup the default list of scripts with the default options. The list of script is viewable at /scripts. These default scripts cannot be deleted. You can create additional scripts for use by you as required. Your script will be based on one of the existing scripts and have custom options applied. The scripts can then be downloaded from the list page at menu: Discover -> Audit Scripts -> List Audit Scripts.'] = 'Autres La lista de kézmprovves estas rigardebla Tiuj deha.ltaj kézmelleves ne povas esti perigitaj. Vi povas krei kromajn manikriptojn por uzo de vi kiel postulat. ビア マニクリプト estos bazita sur unu el ekzistantaj manikriptoj kaj havas kutimo eblojn aplikitaj. La maniskriptoj tiam povas esti el apretutitaj de la listpa pila Valikko: Malkovru - titulado Scripts de オーディション - Lista de scripts de オーディション.';

$GLOBALS["lang"]['We need some credentials to be able to effectively talk to the devices on your network.'] = 'Ni bezonas jujn akredita. Ojn por povi efike paroli al la aparatoj sur via reto.';

$GLOBALS["lang"]['We only send the minimum amount of data and nothing of a sensitive nature. We send our license data (name, type, etc), our application data (name, version, platform, timezone, etc), any logged errors, a count of device types and a count of the features used. <i>Any</i> environment has devices and that is the only piece of your data we send. And only the type of device and a count. Not the manufacturer, not the model. We send nothing special. No networks. No IP addresses. No OS versions. No software names. The UUID and Server fields are sha256 encoded (so we do not know the value). We send just the data we need to improve the product. We hope you see the benefit to all of us with this information. It will provide us guided direction on where to focus improvements and new features in the product.'] = 'Ni nur sendas la miniman kvanton de datumoj kaj nénion de senima naturo. Ni sendas niajn licenzadatenojn (nomo, tipo, ktp), niaj apliki <i>Il n\'è un pas デ</i> Medio havas aparatojn kaj tio estas la nura peco de viaj datenoj kiujn ni sendas. Kaj nur la speco de aparato kaj kalkulo. Ne la produktanto, ne la modelo. Ni sendas ネニオン スペシャルエン。 Neniujのretoj。 Neniu IP アドレゾ。 Neniu versio de Os. La UID kaj Servilo kampraj estas sha256. Ni sendas nur la datumojn, kiujn ni bezonas plibonigi la produkton. Ni esperas, ke vidas la avanta fusion al chiuj niaj soatoj. ';

