$GLOBALS["lang"]['When a subnet discovery is executed it first runs, if selected, an Nmap ping scan on the range or IP addresses. Any device responding will be port scanned. If an Nmap ping scan is not requested, each IP is individually port scanned. Which ports? That is determined by the'] = 'Sous-nettrova de kiam Se Nmap ping- skanado neestas postuladita, Kiujn Hasnojn? ティオ estas deterorita';

$GLOBALS["lang"]['When auditing a Linux device via SSH, some Linux distributions do not allow sudo commands to be passed without a TTY (which we are doing). To completely audit one of these linux distributions it is best to supply the root user credentials. If no root is supplied and sudo without a TTY is not possible, the audit script will be run but will not contain the amount of data as would otherwise. Subsequent audits using root (or run locally using sudo) will therefore provide extra details about the system and generate several <i>changes</i>.'] = 'Dum reviziado de Linukso- SSH, ケルカジ Linukso- distributioj ne permesas al 115 kommundoj esti pasitaj sen TTY (kiu ni faras). L\'utility de l\'énergie nucléaire dans le secteur de l\'énergie est une 条件 préalable à l\'utilità de l\'énergie nucléaire. Se neniu の半径子のestas provizita kaj eksterlande sen TTY ne estas ebla, la reviziomanuskripto estos prizorgita sed ne enhavas la kvanton de datenoj kiel alie. Postaj revizioj uzantaj ラジコン (katlusega kuro loke uzanta sekson) tiaal disponigas ekstrajn detalojn pri la simemo kaj suvut plurajn detalojn. <i>раннннововоj</i>お問い合わせ';

