$GLOBALS["lang"]['When matching a Linux based device, we prefer to use the Dbus id concatenated with the hostname. We can also use other options as per the below table, but we can retrieve the Dbus ID without root. To retrieve the UUID (from the motherboard), we need to run dmidecode, which does require root. Unfortunately, when you clone an ESXi guest, the Dbus ID does not get recreated - hence our concatenating this with the hostname. There is a good article linked here that details the <i>why</i> of hardware IDs.'] = 'Dum egalado de Linukso- bazita aparato, ni likeas uzi la Dbus- identigon akompanate kun la mastro-nomo. C\'e\' piu\' の vrai. Por preni la UUID (de la patrintabulo), ni murs kuri dmidecode, kiu postulas radekon. ベダ・アウディリンデ、キム・ヴィ・クロンサESXi ガスタン、ラ・ドバス ID ネ ライヴヴァス・レクリタン - 道 nia akompanantation kun la mastro-nomo。 Ekzistas bona artikolo ligita (イクジスタ) <i>キアルキル</i> Kahtlustustomobilajのidentificagiloj。';

