$GLOBALS["lang"]['With the 3.3.0 release of Open-AudIT we have introduced the concept of a Cluster. This intuitively maps to the idea of a web cluster, database cluster or file cluster (or one of several other purposes) into a given type (high availability, redundancy, scaling, etc).<br><br>Depending on the purpose of cluster chosen, the reporting will be slightly different.<br><br>For example, if you create a Cluster with a purpose of virtualisation, when you have added devices to it you will also see the virtual machines on those devices.'] = 'Kun la 3.3.0 liberigo de Open- 監査 ni lan curvais la koncepton de Cluster. Tiu intuicie mapas al la ideo de interretreto, ベース de donnéesa sur un epäillyn dosierato (unu el pluraj alfaj celoj) en anta.fiksitan tipon (alta hasbleco, redundo, skalado, ktp).<br/><br/>Riippuu de la celo de isto ektita, la raportado estos iomete malsama.<br/><br/>Ekzample、se viのkreas クラスター kun celo de virtualigo, kiam vi aldonis aparatojn al εi vi ankavidos la virtualajn mainojn sur tiauj aparatoj.';

